import React from 'react'
import Login from './Login'
import Home from './Home'
import { BrowserRouter, Route, Routes } from 'react-router-dom'

export default function App() {
  return (
    
    <BrowserRouter>

    <Route path='/home' element={<Home/>}/>
    
    <Routes><Login/>
    
    </Routes>
    </BrowserRouter>
  )
}
